import React from 'react';
import Addproducts from './Addproducts';

function Dashboard() {
    return (
      <div>
        <h2>Welcome to the Dashboard!</h2>
      
      <h2>Add New Product</h2>
      <Addproducts />
    </div>
    );
}
  
export default Dashboard;
